import React from "react";
import Style from "./Profile.css";
import { TextSubtitle, TextTitle, ImageAvatar } from "../../atoms";
import { LabelAvatar } from "../../molecules";

export const Profile = ({ url, des, name, job, isNew }) => {
  return (
    <div className={Style.Profile}>
      {isNew && <Label_avatar />}
      {url === undefined ? (
        <Text_title content="none" />
      ) : (
        <>
          <Image_avatar src={url} alt={des} />
          <Text_title content={name} />
          <Text_subtitle content={job} />
        </>
      )}
    </div>
  );
};
